import CartIcon from "../Cart/CartIcon"
import { Fragment } from "react"
const button=(props)=>{
    return(
        <Fragment>
        <span><CartIcon></CartIcon></span>
        <span>Your Cart</span>
        <span>1</span>
        </Fragment>
    )
}
export default button
